import './App.css';
import React from 'react';

const Tarjeta = ({props}) => {
    return (
        <div className="Tarjeta">
            <div className="Tarjeta-superior">
                <div className="Tarjeta-superior-izq">Título</div>
                <div className="Tarjeta-superior-der">A</div>
            </div>
            <div className="Tarjeta-inferior">
                <div className= "Tarjeta-inferior-auditor"> Auditor: Hugo Fernández</div>
                <div className= "Tarjeta-inferior-fecha">Fecha: 30 de Marzo</div>
            </div>
        </div>
    );
}

export default Tarjeta;
